&lt;h3&gt;What is Google Drive?&lt;/h3&gt;

&lt;p&gt;Google Drive is a cloud-based storage service that enables users to store and access files online. The service syncs stored documents, photos and more across all the user&#39;s devices, including mobile devices, tablets and PCs.&lt;/p&gt;

&lt;p&gt;Google Drive integrates with the company&#39;s other services and systems -- including&nbsp;&lt;a href=&quot;https://www.techtarget.com/whatis/definition/Google-Docs&quot;&gt;Google Docs&lt;/a&gt;, Gmail, Android,&nbsp;&lt;a href=&quot;https://www.techtarget.com/whatis/definition/Google-Chrome-OS&quot;&gt;Chrome&lt;/a&gt;, YouTube,&nbsp;&lt;a href=&quot;https://www.techtarget.com/searchbusinessanalytics/definition/Google-Analytics&quot;&gt;Google Analytics&lt;/a&gt;&nbsp;and&nbsp;&lt;a href=&quot;https://www.techtarget.com/whatis/definition/Google-plus&quot;&gt;Google+&lt;/a&gt;. Google Drive competes with Microsoft OneDrive, Apple iCloud, Box, Dropbox and SugarSync.&lt;/p&gt;

&lt;h3&gt;How does Google Drive work?&lt;/h3&gt;

&lt;p&gt;To get started with Google Drive, the user must create or sign in to a Google account. Then, the user types&nbsp;&lt;em&gt;drive.google.com&lt;/em&gt;&nbsp;into their browser. My Drive will automatically appear, which can contain uploaded or synced files and folders, as well as&nbsp;&lt;a href=&quot;https://www.techtarget.com/whatis/definition/Google-Spreadsheets&quot;&gt;Google Sheets&lt;/a&gt;, Google Slides and Google Docs files. Then, the user can either upload files from their computer or create files in Google Drive.&lt;/p&gt;

&lt;p&gt;Alternatively, the user can download a Google Drive application to one or more devices. A Google Drive folder will appear along with other folders in each device&#39;s file system. Files that the user adds to one folder are available through a Google Drive web app or the Google Drive folder on each device.&lt;/p&gt;

&lt;p&gt;When a user creates a file or folder, they become its&nbsp;&lt;em&gt;owner&lt;/em&gt;&nbsp;by default. The owner can control the level of visibility -- public or privately shared with specific Google accounts -- and transfer ownership to another user using Gmail addresses. The owner can also regulate permissions for both folders and files, using access levels such as&nbsp;&lt;em&gt;editor&lt;/em&gt;,&nbsp;&lt;em&gt;viewer&lt;/em&gt;&nbsp;and&nbsp;&lt;em&gt;commenter&lt;/em&gt;.&lt;/p&gt;
